import React from "react";
import { motion } from "framer-motion";

const ImageGrid = ({ places, setSelectedImg }) => {
    return (
        <div className="img-grid">
            {places &&
                places.map((place) => (
                    <motion.div
                        className="img-wrap"
                        key={place.id}
                        layout
                        whileHover={{ opacity: 1 }}
                        s
                        onClick={() => setSelectedImg(place.url)}
                    >
                        <motion.img
                            src={place.url}
                            alt="uploaded pic"
                            initial={{ opacity: 0 }}
                            animate={{ opacity: 1 }}
                            transition={{ delay: 1 }}
                        />
                    </motion.div>
                ))}
        </div>
    );
};

export default ImageGrid;
